import React from 'react'
import '../../App.css';
const Navbar = () => {

    const links = ["HOME", "ABOUT US","CONTACT US"];

    return (
        <div className='Navbar'>
            <div className='leftSide'>
                {links.map((link) =>{
                    return (
                        <a>${link}</a>
                    )
                })}
            </div>
            <div className='rightSide'></div>
        </div>
    )
}

export default Navbar
